import React from "react";
import * as S from "./style";
import { ReactComponent as CalendarIcon } from "../../assets/icons/calendar.svg";

interface Props {
  month: number;
  borrowed: number;
  received: number;
}

const LoanCard = (props: Props) => {
  return (
    <div>
      <S.Calendar>
        <CalendarIcon />
      </S.Calendar>
      <S.Money>
        <div></div>
        <div></div>
      </S.Money>
    </div>
  );
};

export default LoanCard;
